/**
 * Get image source by path
 * @param path - Path from database (e.g. '/assets/digimon/agumon.png')
 * @returns Image source for require()
 */
export function getImageByPath(path: string | undefined): any {
  if (!path) {
    return require('../assets/digimon/agumon_professor.png');
  }
  
  // Handle paths with or without leading slash
  const normalizedPath = path.startsWith('/') ? path : `/${path}`;
  
  // Check if path exists in map
  if (imageMap[normalizedPath]) {
    return imageMap[normalizedPath];
  }
  
  // Try without the leading slash
  if (imageMap[normalizedPath.substring(1)]) {
    return imageMap[normalizedPath.substring(1)];
  }
  
  // Fallback to default image
  return require('../assets/digimon/agumon_professor.png');
}

export default imageMap;
